cursor = conn.cursor()

# Insert each video into the videos table
for video in video_data:
    cursor.execute(
        "INSERT or ignore INTO videos (title, url, publish_date, tags, channel_name, channel_url) VALUES (?, ?, ?, ?, ?, ?)",
        (video["title"], video["url"], video["publishDate"], "Retro Gaming", "Retro Handhelds", "https://www.youtube.com/@retrohandhelds")
    )

# Commit and close the connection
conn.commit()
conn.close()

